module.exports = "<div class=\"fotoCabecera\">\n  <img src=\"assets/images/tiendas/cabecera_charcuredondo.png\" alt=\"\">\n</div>\n\n<div id=\"contenedor-redondo\">\n  <div class=\" container contenedor-imgtext\">\n    <div class=\"imagen-lateral\">\n      <img src=\"assets/images/tiendas/luis-alberto.png\" alt=\"luis-alberto\">\n    </div>\n    <div class=\"texto texto-1\">\n      <img src=\"assets/images/tiendas/luis-alberto-bocadillo.png\" alt=\"luis-alberto-bocadillo\">\n      <p>\n        Mi hermano José María y yo somos los hijos del fundador, Alicio Redondo, y junto con mi mujer Nieves, regentamos\n        las tres tiendas de Valladolid. Yo me ocupo de la tienda de la calle Joaquín María Jalón 18, local de casi 200\n        metros donde atendemos a diario la demanda de nuestros productos para los clientes del barrio y de otras zonas\n        de Valladolid. Doménico, Nacho, Juan, Henar y Alberto (mi hijo), formamos un equipo sin competencia. Esta\n        carnicería está en la zona sur de la ciudad. Llevamos años en esta calle, pero anteriormente en un local algo\n        más pequeño, del que nos trasladamos para poder atender mucho mejor a nuestros clientes, que al final es lo\n        importante.\n      </p>\n    </div>\n  </div>\n  <div class=\"container contenedor-imgtext\">\n    <div class=\"texto texto-2\">\n      <img src=\"assets/images/tiendas/tienda-portillo-prado-bocadillo.png\" alt=\"tienda-portillo-bocadillo\">\n      <p>\n        Nuestro padre comenzó en el año 1967 en la Avenida de Palencia y después se trasladó a la calle Portillo del\n        Prado, 17, la tienda la más grande, con casi 300 m2. Está dirigida por José María, experto charcutero y\n        carnicero, Manuel y Begoña completan este estupendo equipo. De las tres carnicerías, esta es la que tiene más\n        espacio dedicado a la exposición y venta de vinos. Está situada en el barrio de la Rondilla, al norte de la\n        ciudad.\n      </p>\n    </div>\n    <div class=\"imagen-lateral\">\n      <img src=\"assets/images/tiendas/tienda-portillo-prado.png\" alt=\"tienda portillo\">\n    </div>\n  </div>\n  <div class=\"container contenedor-imgtext\">\n    <div class=\"imagen-lateral\">\n      <img src=\"assets/images/tiendas/mateo-seoane.png\" alt=\"mateo-seoane\">\n    </div>\n    <div class=\"texto texto-1\">\n      <img src=\"assets/images/tiendas/mateo-seoane-bocadillo.png\" alt=\"mateo-seoane-bocadillo\">\n      <p>\n        Esta es la carnicería más pequeña de las tres y “la que tiene el mejor equipo”, por lo menos eso es lo que dice\n        mi mujer, Nieves, que es la que regenta el negocio (¡¡es muy competitiva!!). A parte de la competencia por\n        querer ser mejor, tener la exposición más bonita, mejor surtida, limpia y coqueta, el equipo compuesto por\n        Esther, César, Jaime y Nieves hace un espléndido trabajo desde este local situado en la calle Mateo Seoane\n        Sobral, 3 del barrio de Parquesol, en la zona oeste de Valladolid. Un barrio vibrante con muchas familias\n        jóvenes.\n      </p>\n    </div>\n  </div>\n</div>\n\n<div class=\"producto-ficha redondo\" [ngClass]=\"{'open': vistaApartado}\"\n  [class.enScroll]=\"_datosService.globalScroll || _datosService.seccion != 'productos'\">\n  <div class=\"container\">\n    <div class=\"titular text-center padding-top-5 padding-bottom-5\">\n      <h1 class=\"titulo text-center tituloRedondo\">Profesionales desde 1967</h1>\n    </div>\n    <div class=\"row\">\n      <div class=\"col-md-12\">\n        <p>Redondo Charcutería, una de las mejores carnicerías en Valladolid, está formada por profesionales de la\n          industria cárnica desde 1967. Elaboramos y servimos productos cárnicos y charcutería de elaboración propia.\n        </p>\n        <p>Nuestros principales productos son carne de ternera de Portillo, carne de cerdo, cordero, lechazo, pollo,\n          conejo, cochinillo, embutidos, quesos, bacalao, vinos, conservas y encurtidos.\n          Todos los productos son de <strong>máxima calidad</strong> y somos especialistas en charcutería y productos\n          naturales elaborados con métodos tradicionales, precocinados, embutidos, conservas, vinos y productos gourmet,\n          ya que somos una de las mejores carnicerías de Valladolid.</p>\n        <p>Nuestro padre, Alicio Redondo, era uno de los charcuteros más reconocidos en Valladolid. Su\n          <strong>experiencia y apuesta por la calidad</strong> de los productos que comercializaba, llevaron a la\n          empresa a la senda del éxito. Desde pequeños nos inculcó el conocimiento y el amor por su trabajo. En la\n          actualidad somos los hijos y familia, los que desarrollamos la actividad con el mismo cariño.\n        </p>\n\n        <p>Hoy en día comercializamos nuestros productos en tres carnicerías en Valladolid: Portillo del Prado 17,\n          Joaquín María Jalón 18 y Mateo Seoane Sobral 3. De esta manera cubrimos gran parte de la geografía de la\n          ciudad.</p>\n        <p>A través de nuestra página web, queremos dar un servicio de charcutería, carnicería y productos de calidad\n          online, puerta a puerta, en la provincia de Valladolid.</p>\n      </div>\n      <div class=\"col-md-12 text-center\">\n        <div class=\"btn btn-comprar\" routerLink=\"/tienda\"> <span>ir a tienda</span> </div>\n      </div>\n    </div>\n  </div>\n</div>"

